import Layout from '../components/Layout'
import { Container, Row, Col } from 'reactstrap'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCookie } from '@fortawesome/free-solid-svg-icons'
import { faCannabis } from '@fortawesome/free-solid-svg-icons'
import { faJoint } from '@fortawesome/free-solid-svg-icons'
import { faBong } from '@fortawesome/free-solid-svg-icons'
import Dropdown from 'react-bootstrap/Dropdown'


const Index = () => (
    <Layout>
        <>
            <Container>
                <h1>The Menu</h1>
                <Row>

                    <Col>
                        <div id="coffee">
                            <Dropdown>
                                <Dropdown.Toggle variant="success" id="dropdown-basic">
                                <FontAwesomeIcon icon={faCannabis} height="150px" width="150px" />
                                </Dropdown.Toggle>

                                <Dropdown.Menu>
                                    <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
                                    <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
                                    <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
                                </Dropdown.Menu>
                            </Dropdown>
                        </div>
                    </Col>

                    <Col>
                        <div id="cannabis">
                            <button type="button" className="btn btn-danger" id="btn-weed"><FontAwesomeIcon icon={faCookie} height="150px" width="150px" /></button>
                        </div>
                    </Col>

                    <Col>
                        <div id="joint">
                            <button type="button" className="btn btn-warning" id="btn-weed"><FontAwesomeIcon icon={faJoint} height="150px" width="150px" /></button>
                        </div>
                    </Col>

                    <Col>
                        <div id="bong">

                            <button type="button" className="btn btn-primary" id="btn-weed"> <FontAwesomeIcon icon={faBong} height="150px" width="150px" /></button>
                        </div>
                    </Col>

                </Row>
                <br />

                <style jsx>
                    {`


               h1 {
                   text-align: center;
                   margin-top: 10px;
                   text-decoration: underline;
               }
               #coffee {
                   color: brown;

                   margin-left: 15px;


               }
               #cannabis {
                   color: green;

                   margin-left: 15px;

               }
               #joint {
                   color: brown;

                   margin-left: 15px;

               }
               #bong{

                margin-left: 15px;
                color: blue;

               } 
               #btn-weed {
                   display: flex;
                   margin-left: 35px;
                   margin-top: 5px;
                   margin-bottom: 3px;
               }

               `}
                </style>

            </Container>
        </>
    </Layout>
)

export default Index;
